import classes from './Navigation.module.css'

const Navigation = () => {
    return (
        <nav>
            <ul>
                <li><a href="/profile">Profile</a></li>
                <li><a href="">Dialogs</a></li>
                <li><a href="">Dating</a></li>
                <li><a href="">Likes</a></li>
                <li><a href="">Settings</a></li>
            </ul>
        </nav>
    )
}

export default Navigation;
